import React from 'react';
import "./SearchC.css";

const AddC = () => {
  
  return (
    
    <div class="login-page">
    <div class="form">
      
      <form class="login-form">
        <input type="text" placeholder="cow code"/>
<Link to="/proc">
        <button>search</button>
        </Link>
        </form>
    </div>
  </div>
  )
}

export default AddC
